      :root {
        --cls-color: #409ef2;
        --cls-sec-color: #a3baff;
        --cls-size: 5rem;
        --cls-margin: 1rem;
        --cls-speed: 2s;
      }

      @keyframes spin {
        0% {
          transform: rotate(0deg);
        }
        100% {
          transform: rotate(360deg);
        }
      }

      [class^='cls-'] {
        box-sizing: border-box;
      }

      .cls-spinner {
        display: block;
        position: relative;
        width: var(--cls-size);
        height: var(--cls-size);
        margin: var(--cls-margin);
        margin: auto;
        position: absolute;
        top: 45%;
        right: 50%;
        transform: translateX(50%) translateY(-45%);
      }

      .cls-spin {
        animation: spin var(--cls-speed) linear infinite;
      }

      .cls-circle {
        border-width: calc(var(--cls-size) / 5 * 0.75);
        border-style: solid;
        border-color: var(--cls-sec-color);
        border-top-color: var(--cls-color);
        border-radius: 50%;
        width: 100%;
        height: 100%;
      }
